('1878','2','8225','Wohnung Proksch Santa Barbara',Null,'Duplex Wohnung mit Hafenblick in Palma','23501','Am kleinen Hafen von Santa Barbara liegt diese 208 m² große Duplex-Wohnung mit einem sehr schönen Blick auf den Fischerhafen mit seinen pittoresken Booten. Die Wohnung erreicht man auch mit dem Lift von der Tiefgarage aus, wo 2 Parkplätze für den Eigentümer zur Verfügung stehen. Die obere Wohnetage liegt im 1. Obergeschoss. Hier befinden sich ein Wohn-Esszimmer mit Terrasse, Küche mit Hauswirtschaftsraum, Gäste-WC, ein Büroraum und ein Schlafzimmer mit Ankleide und Badezimmer en suite.\r\nÜber eine Wendeltreppe erreicht man das Erdgeschoss (Hochparterre) mit 2 weiteren Schlafzimmern und 2 Badezimmern. Zur Ausstattung gehören Parkettfußboden, Marmorfußboden, Klimaanlage w/k und Holz-Doppelglasfenster. Einen spektakulären Blick über den Hafen bietet die gemeinschaftliche Dachterrasse, die auch einen wo auch einen Swimming Pool zum Erfrischen und Entspannen bietet. Die Wohnung wird unmöbliert verkauft.','23502','620000','111','2012-09-03 15:45:15','110','2012-09-03 15:45:18',Null,'1568','105','735',1,'1','0',Null,Null,Null,'23503',Null,'0','0','0',Null,'2016-01-29 14:44:01',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'23504',Null,'23505',Null,'23506',Null,'23507',Null,'23508','0',0,'0');
